const Tasks = ({finalresu}) => {

  return (
    <>
      <div className="aline">
        <h3 style={{backgroundColor: finalresu[0].resu<50 ?'rgb(174, 10, 4)' : 'rgb(0, 255, 17)'}}>{finalresu[0].name}</h3>  
        <div className="showState">
          {finalresu[0].resu < 50 ? 'F' : 'A'}
        </div>
      </div>
      <h3>{finalresu[0].id}</h3>  
      <h3>{finalresu[0].resu}</h3>  
    </>
  )
}

export default Tasks
